        public static int MakeAnagram(string a, string b)
        {
            a = "showman";
            b = "woman";

            int LenA = a.Length;
            int LenB = b.Length;

            var ListA = new List<char>(LenA);
            var ListB = new List<char>(LenB);

            ListA = a.ToList();
            ListB = b.ToList();

            int total = LenA + LenB;

            int count = 0;

            for (int i = 0; i < LenA; i++)
            {
                if (ListB.Contains(ListA[i]))
                {
                    count++;
                    ListB.Remove(ListA[i]);
                }
            }

            return total - (2 * count);
        }

        public static List<string> FunWithAnagrams(List<string> text)
        {
            text = new List<string>() { "code", "doce", "ecod", "framer", "frame" };

            for (var i = 0; i < text.Count; i++)
            {
                for (var j = text.Count - 1; j > i; j--)
                {
                    var elementA = text[i];
                    var arrayA = elementA.ToCharArray();
                    Array.Sort(arrayA);
                    var arrayAStr = string.Join("", arrayA);

                    var elementB = text[j];
                    var arrayB = elementB.ToCharArray();
                    Array.Sort(arrayB);
                    var arrayBStr = string.Join("", arrayB);

                    if (arrayAStr == arrayBStr)
                    {
                        text.RemoveRange(j, 1);
                    }
                }
            }

            text.Sort();
            return text;
        }

        // You are given a string containing characters  and  only.
        // Your task is to change it into a string such that there are no matching adjacent characters.
        // e.g. AAAA, AAAABAB
        public static int AlternatingCharacters(string s)
        {
            int deletions = 0;
            int length = s.Length;
            var charArray = s.ToCharArray();

            for (int i = 0; i < length; i++)
            {
                var currentChar = charArray[i];
                var nextChar = i + 1 < length ? charArray[i + 1] : char.MinValue;
                if (currentChar.Equals(nextChar))
                {
                    deletions++;
                }
            }

            return deletions;
        }

        /**
         * Sherlock considers a string to be valid if all characters of the string appear the same number of times.
         * It is also valid if he can remove just 1 character at 1 index in the string, and the remaining characters will occur the same number of times.
         * Given a string , determine if it is valid. If so, return YES, otherwise return NO.
         */
        public static string SherlockandtheValidString(string s)
        {
            const string yes = "YES";
            const string no = "NO";

            s = "aabbc"; // "abcdefghhgfedecba" - return yes
            //s = "aabbcd"; "aabbccddeefghi" - return no
            var charList = s.ToList();
            charList.Sort();

            bool isValid = true;
            var usedChars = new List<KeyValuePair<char, int>>();

            for (int i = 0; i < s.Length; i++)
            {
                var currentChar = charList[i];
                if (!usedChars.Exists(x => x.Key.Equals(currentChar)))
                {
                    var reps = 1;
                    for (int k = i + 1; k < s.Length; k++)
                    {
                        if (currentChar.Equals(charList[k]))
                        {
                            reps++;
                        }
                    }
                    usedChars.Add(new KeyValuePair<char, int>(currentChar, reps));
                }
            }

            var grouped = usedChars.GroupBy(x => x.Value).ToList();

            if (grouped.Count() > 2)
            {
                isValid = false;
            }
            else if (grouped.Count() == 2)
            {
                var max = usedChars.Select(x => x.Value).Max();
                var min = usedChars.Select(x => x.Value).Min();
                var valuesForMax = grouped.FirstOrDefault(x => x.Key == max).Select(x => x.Value).ToList();
                var valuesForMin = grouped.FirstOrDefault(x => x.Key == min).Select(x => x.Value).ToList();

                if (valuesForMax.Count() >= 2 && valuesForMin.Count() >= 2)
                {
                    isValid = false;
                }
                else if (valuesForMin.Count() == 1 && min - 1 != 0)
                {
                    isValid = false;
                }
                else
                {
                    if (valuesForMax.Count() == 1 && valuesForMax[0] - 1 != min)
                    {
                        isValid = false;
                    }
                }
            }

            return isValid ? yes : no;
        }

        /**
         * A string is said to be a special string if either of two conditions is met: 
         * All of the characters are the same, e.g. aaa.
         * All characters except the middle one are the same, e.g. aadaa.
         * A special substring is any substring of a string which meets one of those criteria. Given a string, determine how many special substrings can be formed from it.
         */
        public static long SubstrCount(int n, string s)
        {
            // below result is 1272919 
            s = "";

            var charArray = s.ToCharArray();
            long count = s.Length;
            for (int i = 0; i < s.Length; i++)
            {
                var currentChar = charArray[i];
                int sequence = 1;
                for (int k = i + 1; k < s.Length; k++)
                {
                    var nextChar = charArray[k];
                    if (currentChar.Equals(nextChar))
                    {
                        sequence++;
                        count++;
                    }
                    else
                    {
                        if (k + sequence < s.Length)
                        {
                            bool isMiddle = true;
                            for (int nextS = 1; nextS <= sequence; nextS++)
                            {
                                var nextInSequence = charArray[k + nextS];
                                if (!currentChar.Equals(nextInSequence))
                                {
                                    isMiddle = false;
                                }
                            }
                            if (isMiddle)
                            {
                                count++;
                            }
                        }
                        break;
                    }
                }
            }

            return count;
        }

