        private static int GetLongestCommonSubsequence(char[] s1Arr, char[] s2Arr, int l1, int l2)
        {
            if (l1 == 0 || l2 == 0)
            {
                return 0;
            }
            else if (s1Arr[l1 -1].Equals(s2Arr[l2 -1]))
            {
                return 1 + GetLongestCommonSubsequence(s1Arr, s2Arr, l1 -1, l2 - 1);
            }
            else
            {
                return Math.Max(GetLongestCommonSubsequence(s1Arr, s2Arr, l1, l2 - 1), GetLongestCommonSubsequence(s1Arr, s2Arr, l1 - 1, l2));
            }
        }
